import React from 'react';
import CountUp from 'react-countup';
import TrackVisibility from "react-on-screen";
import ScrollAnimation from "react-animate-on-scroll";

const Data = [
    {
        countNum : 199,
        countTitle: 'Happy Clients.',
    },
    {
        countNum : 575,
        countTitle: 'Employees',
    },
    {
        countNum : 69,
        countTitle: 'Useful Programs',
    },
    {
        countNum : 500,
        countTitle: 'Useful Programs',
    },
];

const SlipThree = () => {
    return (
        <div className="rn-splite-style bg-color-blackest">
            <div className="split-wrapper">
                <div className="row no-gutters radius-10 align-items-center">
                    <div className="col-lg-12 col-xl-6 col-12">
                        <div className="thumbnail">
                            <img src="./images/split/split-03.jpg" alt="split Images" />
                        </div>
                    </div>
                    <div className="col-lg-12 col-xl-6 col-12">
                        <div className="split-inner">
                            <ScrollAnimation 
                            animateIn="fadeInUp"
                            animateOut="fadeInOut"
                            animateOnce={true}>
                                <h4 className="title">Continue Your Business With Us.</h4>
                            </ScrollAnimation>
                            <ScrollAnimation 
                            animateIn="fadeInUp"
                            animateOut="fadeInOut"
                            animateOnce={true}>
                                <p className="description">At CFS, we streamline your international trade experience through expert customs brokerage services. Our team adeptly handles customs clearance, ensuring your shipments navigate smoothly across borders. From preparing essential documentation to ensuring compliance with global trade regulations, we cover all aspects of customs processing.

With our in-depth knowledge and proactive approach, we minimize delays and reduce the risk of penalties, ensuring timely and efficient delivery of your goods. Trust Capital Freight Solutions to be your reliable partner in global trade, simplifying customs complexities every step of the way.</p>
                            </ScrollAnimation>

    
                            </div>
                        </div>
                    </div>
                </div>
            </div>
    )
}
export default SlipThree;
